import React, { useState } from "react";

const PatientForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    gender: "male",
    dob: "",
    phone: "",
    address: "",
    image: null,
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, image: e.target.files[0] });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form Data Submitted:", formData);
  };

  return (
    <div className="p-8 bg-gray-100 min-h-screen">
      <h2 className="text-2xl font-semibold mb-6">Thêm bệnh nhân</h2>
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md">
        <div className="grid grid-cols-2 gap-6">
          {/* Left Column */}
          <div>
            <label className="block font-medium">Họ và tên *</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Họ và tên"
              className="w-full border rounded-md p-2 mt-1"
              required
            />
            <label className="block mt-4 font-medium">Giới tính *</label>
            <div className="flex gap-4">
              <label className="flex items-center">
                <input
                  type="radio"
                  name="gender"
                  value="male"
                  checked={formData.gender === "male"}
                  onChange={handleChange}
                  className="mr-2"
                />
                Nam
              </label>
              <label className="flex items-center">
                <input
                  type="radio"
                  name="gender"
                  value="female"
                  checked={formData.gender === "female"}
                  onChange={handleChange}
                  className="mr-2"
                />
                Nữ
              </label>
            </div>
            <label className="block mt-4 font-medium">Ngày sinh *</label>
            <input
              type="date"
              name="dob"
              value={formData.dob}
              onChange={handleChange}
              className="w-full border rounded-md p-2 mt-1"
              required
            />
          </div>

          {/* Right Column */}
          <div>
            <label className="block font-medium">Ảnh *</label>
            <input type="file" onChange={handleFileChange} className="w-full border rounded-md p-2 mt-1" required />
            <label className="block mt-4 font-medium">SĐT *</label>
            <input
              type="text"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
              placeholder="Số điện thoại"
              className="w-full border rounded-md p-2 mt-1"
              required
            />
            <label className="block mt-4 font-medium">Địa chỉ *</label>
            <input
              type="text"
              name="address"
              value={formData.address}
              onChange={handleChange}
              placeholder="Địa chỉ"
              className="w-full border rounded-md p-2 mt-1"
              required
            />
          </div>
        </div>
        
        {/* Buttons */}
        <div className="mt-6 flex justify-between">
          <button type="submit" className="bg-teal-700 text-white px-4 py-2 rounded-md">Lưu lại</button>
          <button type="button" className="bg-red-500 text-white px-4 py-2 rounded-md">Quay lại</button>
        </div>
      </form>
    </div>
  );
};

export default PatientForm;
